import React from 'react'
import CreateUsersItems from './CreateUsersItems';

const CreateUsersPage = ({ editUser, userItems, deleteUser, activeModal }) => {
    return (
        <div className="App">
            <header className="header flex">
                <div className="conteiner header_conteiner flex">
                    <div className="header_mem_text">
                        <h1>Logo</h1>
                    </div>
                    <div className="authentication flex">
                        <a href="login.html" className="home_page_link header_link flex">
                            <span>Вход</span>
                        </a>
                        <a href="registration.html" className="home_page_link header_link flex">
                            <span>Регистрация</span>
                        </a>
                    </div>
                </div>
            </header>
            <div className="back_btn">
                <a href="index.html" className="back_btn_link">Назад</a>
            </div>
            <main className="main">
            <UserEditorWindow
            activeModal={editorWindowActive}
            setActiveModal={setEditorWindowActive}
            id={item.id}
            name={item.name}
            email={item.email}
            phone={item.phone}
            password={item.password}
            />
                <div className="container home_page_container">
                    {userItems.map(item =>
                        <CreateUsersItems editUser={editUser} deleteUser={deleteUser} item={item} key={item.id} />)}
                </div>
            </main>
            <footer className="footer"></footer>
        </div>
    )
}

export default CreateUsersPage;
